import React, { Component } from "react";

class About extends Component {
  constructor(props) {
    super(props)

    this.state = {
        HTML_percentage: 50,
        CSS_percentage: 70,
        JS_percentage: 90
    }
  }

  render() {
    return (
      <div>
        <h2>ABOUT</h2>
        <p>I am a designer and developer.</p>
        <p>My Skillset: </p>
        <div>
          <ul class="skills">
          <li>HTML</li> 
          <ExperienceBar HTML_percentage = {this.state.HTML_percentage} />
          <li>CSS</li>
          <ExperienceBar CSS_percentage = {this.state.CSS_percentage} />
          <li>Javascript</li>
          <ExperienceBar JS_percentage = {this.state.JS_percentage} />
          <li>ReactJS</li>
          <li>Python</li>
          <li>Java</li>
          <li>C#</li>
          </ul>
        </div>
      </div>
    );
  }
}

function ExperienceBar(props) {
    return (
        <div className="experience-bar">
        <Progress percentage = {props.percentage} />
        </div>

    )
}

function Progress(props) {
return <div className="progress" style={{ width: `${props.percentage}%`}} />
}
 
export default About;
